DROP TABLE IF EXISTS `BaseUser`;
CREATE TABLE `BaseUser`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `account` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户账号，兼容微信id',
  `password` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `nickName` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `sex` tinyint(1) NULL DEFAULT 0 COMMENT '男性1，女性2，未知0',
  `mobile` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `email` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `address` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '地址',
  `areaId` int(10) NULL DEFAULT NULL COMMENT '所属区域',
  `departmentIds` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '所属部门Id',
  `roleIds` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '角色id',
  `type` tinyint(2) NULL DEFAULT NULL COMMENT '公众1村委2政务3企业4',
  `populationId` int(10) NULL DEFAULT 0 COMMENT '户籍人口表Id',
  `isAuth` int(10) NULL DEFAULT 0 COMMENT '公众用户是否已认证，0未审核， 1待审核，2审核通过，3审核不通过',
  `isLeader` tinyint(2) NULL DEFAULT 0 COMMENT '是否主管人员',
  `status` tinyint(1) NULL DEFAULT 1,
  `isDeleted` tinyint(1) NULL DEFAULT 0,
  `createdAt` timestamp(0) NULL DEFAULT current_timestamp,
  `updatedAt` timestamp(0) NULL DEFAULT current_timestamp ON UPDATE CURRENT_TIMESTAMP,
  `loginedAt` timestamp(0) NULL DEFAULT '0000-00-00 00:00:00',
  `parkAreaId` int(10) NULL DEFAULT 0 COMMENT '园区id',
  `portraitFileId` bigint(20) NULL DEFAULT 0 COMMENT '头像id',
  `householdId` int(11) NULL DEFAULT 0 COMMENT '户码Id',
  `wxopenid` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '小程序openid',
  `description` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '描述/职务',
  `isGrid` int(10) NULL DEFAULT 0 COMMENT '是否网格员，0否， 1一级网格员，2二级网格员(网格长)',
  `test` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `account`(`account`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 393 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户' ROW_FORMAT = Dynamic;

