-- ----------------------------
-- Function structure for mdfun_get_zb_child
-- ----------------------------
DROP FUNCTION IF EXISTS `mdfun_get_zb_child`;
delimiter ;;
CREATE FUNCTION `mdfun_get_zb_child`(in_id varchar(40))
 RETURNS longtext CHARSET utf8
BEGIN
	declare ids LONGTEXT DEFAULT '';
	declare tempids varchar(4000);	

	SET tempids= in_id;
	while tempids is not null do
		set ids = CONCAT_WS(',',ids,tempids);
		select GROUP_CONCAT(id) into tempids from tj_zdyzbdyb where FIND_IN_SET(fid,tempids) >0;
	end while;

	RETURN ids;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for mdproc_delete_zb
-- ----------------------------
DROP PROCEDURE IF EXISTS `mdproc_delete_zb`;
delimiter ;;
CREATE PROCEDURE `mdproc_delete_zb`(IN data bigint)
BEGIN
  -- 本存储过程用于删除指定指标ID及其所有下级子指标
	declare ids LONGTEXT DEFAULT '';
	declare tempids LONGTEXT;	
	
	-- 创建临时表
	DROP table if exists md_temporary;
	create temporary table if not exists md_temporary
	(
			id bigint primary key
	);
	
	
  -- 用递归的方式取出所有的指标ID及其下级指标的ID，放置于ids中
	SET tempids= data;
	while tempids is not null do
		set ids = CONCAT_WS(',',ids,tempids);
		select GROUP_CONCAT(id) into tempids from tj_zdyzbdyb where FIND_IN_SET(fid,tempids) >0;
	end while;
	
	-- 将所有的指标ID插入到临时表中
	
	-- 删除自定义指标表中，指标ID包含在临时表的ID中的记录
	delete from tj_zdyzbdyb where id in (select id from md_temporary);
	
	-- 提交
	commit;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
